   return(
    <>

      <div className="table table-responsive">
      <table>
      <tr>
         <td><RegistrationNavbar/></td>
         <td Style="width:100%">

           <NewDesk></NewDesk>

         </td>
      </tr>
    </table>
      </div>



    </>
   ) 

}

export default CourseRegistration;
